style.css:
@-moz-document domain("news.ycombinator.com") {
  body {
      background-color: #263238;
  }
  table {
      background-color: #37474F;
  }
  a:link {
      color: #fff;
  }
  .hnmore a:visited {
      color: #607D8B !important;
  }
  .pagetop a {
      color: #80CBC4;
  }
  /* comments */
  .subtext a:nth-child(6) {
      color: #FFDEA1;

  }
  /* points */
  .subtext span:first-child {
      color: #338D83;
  }
  /* date */
  .subtext a:nth-child(1) {
      color: #607DB2;
  }
  /* comment text */
  .commtext {
      color: #d0d0d0;
  }
}
